import { Typography } from '@mui/material'
import React from 'react'
import ListingData from '../../Assets/Data/ListingData'

const ProjectListing = () => {
  return (
    <div>
        {ListingData.map((item) => (

            <Typography>
                {item.title}
            </Typography>
        ))}

    </div>
  )
}

export default ProjectListing
